import React from 'react';

export default function Groups() {
  return (
    <div>
      <h3 className="font-bold text-[#4E8DC4] mb-3">Groups</h3>
      <div className="space-y-2">
        <div className="flex items-center justify-between p-2 hover:bg-gray-50 rounded cursor-pointer">
          <span className="text-sm">Team Projects</span>
          <span className="text-xs bg-gray-200 text-gray-600 px-2 py-1 rounded-full">No : 3</span>
        </div>
        <div className="flex items-center justify-between p-2 hover:bg-gray-50 rounded cursor-pointer">
          <span className="text-sm">Personal Notes</span>
          <span className="text-xs bg-gray-200 text-gray-600 px-2 py-1 rounded-full">No : 7</span>
        </div>
      </div>
    </div>
  );
}
